import analytics from "./img/analytics.jpg";

function Analytics () {
    return (
        <div class='analytics'>
            <h1 class="title">Analytics</h1>
            <div className='analytics-img-container'>
                <img src={analytics} className="analytics-image"/>
            </div>
        </div> 
    )
}

export default Analytics;
